import React from 'react';
import './NavigationBarStyle.css';

function NavigationBar() {
  return(
    <div id="mySidenav" class="sidenav">
      <div>
        <a href="https://app.mobalytics.gg/summoner-search">Home</a>
      </div>
    </div>
  )
}

export default NavigationBar;
